import './NavBar.css'

import { NavLink } from 'react-router-dom'
import logo from '../../assets/logo/logoa.png'

const NavBar = () => {
  return (
    <nav>
        <NavLink to='/'>
            <img src={logo} alt="logo" />
        </NavLink>
    </nav>
  )
}

export default NavBar
